import React from "react";
import "./main.css"
import GoodsCard from "../GoodsCard/GoodsCard";


const Main = (props) =>{
    return (
        <div className="main">
         <div className="main-wrapper">
            <div className="goods-wrapper">
                <GoodsCard goodsname="xui"/>
            </div>
         </div>
        </div>
    );
}

export default Main;
